import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";
import "swiper/css/autoplay";
import { Navigation, Pagination, Autoplay } from "swiper/modules";

const Header = () => {
  return (
    <div id="gallery" className="p-6 mt-4">
      <h2 className="text-xl font-semibold text-teal-400 border-b-2 border-teal-500 pb-2">Gallery</h2>
      <Swiper
        slidesPerView={1}
        spaceBetween={10}
        loop={true}
        autoplay={{ delay: 2500, disableOnInteraction: false }}
        navigation
        pagination={{ clickable: true }}
        modules={[Navigation, Pagination, Autoplay]}
        className="mt-4"
      >
        {[...Array(4)].map((_, index) => (
          <SwiperSlide key={index} className="rounded-lg overflow-hidden shadow-lg">
            <img
              src={`https://via.placeholder.com/800x500`}
              alt={`Gallery ${index + 1}`}
              className="w-full h-64 object-cover transform transition-all duration-500 hover:scale-105"
            />
          </SwiperSlide>
        ))}
      </Swiper>
    </div>
  );
};

export default Header;
